app_version: 1.0.0
name: DuoSecurity
description: Easy, Flexible Cybersecurity Solutions for Everyone
contact_info:
  name: "@BhavikPrajapati"
  url: https://shuffler.io
  email: bhavikp@infopercept.com
tags:
  - Working With Duo Security Rest APIs
categories:
  - Testing
authentication:
  required: true
  parameters:
    - name: secret_key
      description: Secret key of Duo security
      example: "*****"
      required: true
      schema:
        type: string
    - name: itegration_key
      description: Itegration key of Duo security
      example: "*****"
      required: true
      schema:
        type: string
    - name: api_host
      description: base url of Duo security server
      example: "https://api-3646f74c.duosecurity.com/"
      required: true
      schema:
        type: string

actions:
  - name: Ping
    description: Endpoint to verify that Duo is up before trying to call other Auth API endpoints
    returns:
      schema:
        type: string

  - name: Check
    description: Endpoint to verify that the Auth API integration and secret keys are valid, and that the signature is being generated properly
    returns:
      schema:
        type: string

  - name: GetLogo
    description: Endpoint provides a programmatic way to retrieve your stored logo.
    returns:
      schema:
        type: string

  - name: EnrollNewUser
    description: Endpoint provides a programmatic way to enroll new users with Duo two-factor authentication. It creates the user in Duo and returns a code (as a QR code) that Duo Mobile can scan with its built-in camera. Scanning the QR code adds the user's account to the app so that they receive and respond to Duo Push login requests.
    parameters:
      - name: username
        description: Username for the created user. If not given, a random username will be assigned and returned
        required: true
        multiline: false
        example: "Your Name"
        schema:
          type: string
    returns:
      schema:
        type: string

  - name: GetEnrollStatus
    description: Endpoint to check whether a user has completed enrollment
    parameters:
      - name: user_id
        description: ID of the user
        required: true
        multiline: false
        example: "DU94SWSN4ADHHJHF2HXT"
        schema:
          type: string
      - name: activation_code
        description: Activation code, as returned from /enroll
        required: true
        multiline: false
        example: "duo://8LIRa5danrICkhHtkLxi-cKLu2DWzDYCmBwBHY2YzW5ZYnYaRxA"
        schema:
          type: string
    returns:
      schema:
        type: string

  - name: PreAuthCheck
    description: Endpoint determines whether a user is authorized to log in, and (if so) returns the user's available authentication factors.
    parameters:
      - name: user_id
        description: Permanent, unique identifier for the user as generated by Duo upon user creation
        required: true
        multiline: false
        example: "DU94SWSN4ADHHJHF2HXT"
        schema:
          type: string
      - name: username
        description: Unique identifier for the user that is commonly specified by your application during user creation (e.g. user@domain.com). This value may also represent a username alias assigned to a user
        required: true
        multiline: false
        example: "abc"
        schema:
          type: string
    returns:
      schema:
        type: string

  - name: Auth
    description: Endpoint performs second-factor authentication for a user by sending a push notification to the user's smartphone app, verifying a passcode, or placing a phone call. It is also used to send the user a new batch of passcodes via SMS.
    parameters:
      - name: user_id
        description: Permanent, unique identifier for the user as generated by Duo upon user creation
        required: true
        multiline: false
        example: "DU94SWSN4ADHHJHF2HXT"
        schema:
          type: string
      - name: username
        description: Unique identifier for the user that is commonly specified by your application during user creation (e.g. user@domain.com). This value may also represent a username alias assigned to a user
        required: true
        multiline: false
        example: "abc"
        schema:
          type: string
      - name: factor
        description: Factor to use for authentication the following choices are supported auto,push,passcode,sms,phone Also see below for additional parameters that are necessary depending on the factor you specify.
        required: true
        multiline: false
        example: "auto"
        schema:
          type: string
      - name: device
        description: ID of the device. This device must have the "push" capability.You may also specify "auto" to use the first of the user's devices with the "push" capability.
        required: true
        multiline: false
        example: "auto"
        schema:
          type: string
      - name: passcode
        description: Passcode entered by the user.
        required: true
        multiline: false
        example: "********"
        schema:
          type: string
    returns:
      schema:
        type: string

  - name: GetAuthStatus
    description: Endpoint "long-polls" for the next status update from the authentication process for a given transaction. That is to say, if no status update is available at the time the request is sent, it will wait until there is an update before returning a response.
    parameters:
      - name: txid
        description: The transaction ID of the authentication attempt, as returned by the /auth endpoint.
        required: true
        multiline: false
        example: "45f7c92b-f45f-4862-8545-e0f58e78075a"
        schema:
          type: string
    returns:
      schema:
        type: string

